pol = ''

def opposites(c1, c2):
	return abs(ord(c1)-ord(c2)) == 32

def get_next_part(s, begin):
	i = 0
	for i in range(begin+1, len(s)):
		if opposites(s[i-1], s[i]):
			return s[begin:i-1], i+1
	return s[begin:], len(s)

def reduce(chain):
	while True:
		i = 0
		subs = []
		while i < len(chain):
			sub, i = get_next_part(chain, i)
			subs += [sub]

		if len(subs) == 1:
			return ''.join(subs)
		else:
			chain = ''.join(subs)

